import React, { useState } from "react";
import { useSelector, useDispatch} from "react-redux";
import { updateAdmin } from "./profile-reducer";

const ProfileComponent = () => {

    // const { admin } = useSelector((state) => state.admin);
    // const [profile, setProfile] = useState(admin);
    // const dispatch = useDispatch();
    // const handleSaveButton = () => {
    //     dispatch(updateAdmin(profile));
    // };

    const [profile, setProfile] = useState(
        {
            "firstName": "Novak", 
            "lastName": "Djokovic", 
            "handle": "@jannunzi",
            "profilePicture": "Novak_400x400.jpeg", 
            "bannerPicture": "ND_banner.jpeg",
            "bio": "Faculty, Software Engineer, AI, Space, and renewable enthusiast. Retuits and likes are not endorsements.",
            "website": "youtube.com/webdevtv",
            "location": "Boston, MA",
            "dateOfBirth": "7/7/1968",
            "dateJoined": "4/2009",
            "followingCount": 340,
            "followersCount": 223
        }
    );


    return (
        <div className="container">
            <h4>Admin Profile Component</h4>

            <div className="row">
                <i className="col-1 bi bi-arrow-left ms-3 mt-3"></i> 
                <span className="col-auto"> 
                    <h5> {profile.firstName} {profile.lastName} </h5>
                    <span>6.115 Tuits</span>
                </span>
            </div>

            <img height={180} className="img-fluid" src={`/images/${profile.bannerPicture}`} alt='Banner Image' />
            <br/>

             <img width={120} className="rounded-circle" 
             src={`/images/${profile.profilePicture}`} alt='Profile Image' />

            <button onClick={"/edit-profile"} className="btn btn-outline-dark rounded-5 mt-3 me-3 float-end">Edit Profile</button>

            <br/>

            <h5 className="fw-bold"> {profile.firstName} {profile.lastName} </h5>
            <div className="text-secondary mb-4"> {profile.handle} </div>

            <div>
                <p>{profile.bio}</p>
            </div>

            <div className="row text-secondary mb-3">
                <div className="col-auto">
                    <i className="bi bi-geo-alt"></i>&nbsp;
                     {profile.location}
                </div>
                <div className="col-auto">
                    <i className="bi bi-balloon"></i>&nbsp;Born {profile.dateOfBirth}
                </div>

                <div className="col-4">
                    <i className="bi bi-calendar3"></i>&nbsp;
                    Joined {profile.dateJoined}
                </div>
            </div>

            <div>
                <span className="fw-bold">{profile.followingCount}</span>
                <span className="text-secondary"> Following </span>
                &nbsp;&nbsp;
                <span className="fw-bold">{profile.followersCount}</span>
                <span className="text-secondary"> Followers </span>
            </div>

            <h2 className="mt-5"> EditProfile component</h2>
            <label>First Name</label><br />
            <input
                value={profile.firstName}
                onChange={(e) => setProfile({
                    ...profile,
                    firstName: e.target.value,
                })} /><br /><br />

            <label>Last Name</label><br />
            <input value={profile.lastName}
                onChange={(e) => setProfile({
                    ...profile,
                    lastName: e.target.value,
                })} /><br /><br />

            <label>Email</label><br />
            <input
                value={profile.email}
                onChange={(e) => setProfile({
                    ...profile,
                    email: e.target.value,
                })} /><br /><br />

            <label>Phone</label><br />
            <input
                value={profile.phone}
                onChange={(e) => setProfile({
                    ...profile,
                    phone: e.target.value,
                })} /><br /><br />

            <label>Address</label><br />
            <input
                value={profile.address}
                onChange={(e) => setProfile({
                    ...profile,
                    address: e.target.value,
                })} /><br /><br />
            {profile.firstName}
            <br/><br/>


        </div>
    );
};

export default ProfileComponent;
